          {
            "kind": "youtube#comment",
            "etag": "QZs-ut15VyT92JoYjHYf1-8TKdc",
            "id": "UgykudmTlaSUe30qn8F4AaABAg.9Bw-hgihW9y9CcfQCEKPrW",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "This is just mind wandering stuff; it is in no way a derivation of a single relativistic equation.  In fact, special relativity is not required - nor does it even apply to the concept that traveling an infinite distance at an infinite speed would take you everywhere in no time.  It&#39;s just obviously true.  Do you even know what the fundamental postulate of special relativity is?  What it is - is a reconciliation of the constancy of the speed of light to Galilean relativity.  The whole concept of relativistic motion and all motion is relative predates Einstein by a couple hundred years.  Most importantly, the law of physics that states that the laws of physics are identical in all inertial reference frames.  This was incompatible with the discovery that the speed of light is the same for all observers regardless of their motion.  Special relativity reconciled the notion that the laws of physics are the same in all inertial reference frames with the fact that the speed of light is the same in all reference frames, and he did it by explaining time dilation and length contraction (among other concepts).  This doesn&#39;t have one iota to do with the blatantly obvious (and really self-evident) fact that traveling an infinite distance at an infinite speed will get you anywhere in zero time.  Ironically, the laws of physics do not allow for infinite speed - as articulated in Einstein&#39;s Special Theory of Relativity.  So, not only did your mind wanderings NOT lead to the discovery of SR; SR actually disallows your mind experiment to actually occur in reality.",
              "textOriginal": "This is just mind wandering stuff; it is in no way a derivation of a single relativistic equation.  In fact, special relativity is not required - nor does it even apply to the concept that traveling an infinite distance at an infinite speed would take you everywhere in no time.  It's just obviously true.  Do you even know what the fundamental postulate of special relativity is?  What it is - is a reconciliation of the constancy of the speed of light to Galilean relativity.  The whole concept of relativistic motion and all motion is relative predates Einstein by a couple hundred years.  Most importantly, the law of physics that states that the laws of physics are identical in all inertial reference frames.  This was incompatible with the discovery that the speed of light is the same for all observers regardless of their motion.  Special relativity reconciled the notion that the laws of physics are the same in all inertial reference frames with the fact that the speed of light is the same in all reference frames, and he did it by explaining time dilation and length contraction (among other concepts).  This doesn't have one iota to do with the blatantly obvious (and really self-evident) fact that traveling an infinite distance at an infinite speed will get you anywhere in zero time.  Ironically, the laws of physics do not allow for infinite speed - as articulated in Einstein's Special Theory of Relativity.  So, not only did your mind wanderings NOT lead to the discovery of SR; SR actually disallows your mind experiment to actually occur in reality.",
