            "videoId": "yuD34tEpRFw",
            "textDisplay": "But does it not only APPEAR to move slowly, how do we truly know it&#39;s actually slowing down?\u003cbr\u003eWe can only observe our measurements of time through something physical like a watch or a photon clock. \u003cbr\u003eOn these objects it may appear as suchbut does it apply to actual time? \u003cbr\u003e\u003cbr\u003eLike the train observing the 2 lighting strikes at different times compared to Einstein being next to them and seeing them at the same time....their may be a difference in observation of the occurrence but if Einstein and the person were to look at their watches, the stop is still the same for each. \u003cbr\u003e\u003cbr\u003eSo is there a way to prove this actually affects time itself? Sorry if I don&#39;t make sense or if this has already been proven, I&#39;m just trying to learn and understand. \u003cbr\u003e\u003cbr\u003eAnother question for the smart people out there...\u003cbr\u003eWhat if time operates differently in different galaxies and planets? \u003cbr\u003eWouldn&#39;t their calculations be different to ours if they were to try work out the same math?",
            "textOriginal": "But does it not only APPEAR to move slowly, how do we truly know it's actually slowing down?\nWe can only observe our measurements of time through something physical like a watch or a photon clock. \nOn these objects it may appear as suchbut does it apply to actual time? \n\nLike the train observing the 2 lighting strikes at different times compared to Einstein being next to them and seeing them at the same time....their may be a difference in observation of the occurrence but if Einstein and the person were to look at their watches, the stop is still the same for each. \n\nSo is there a way to prove this actually affects time itself? Sorry if I don't make sense or if this has already been proven, I'm just trying to learn and understand. \n\nAnother question for the smart people out there...\nWhat if time operates differently in different galaxies and planets? \nWouldn't their calculations be different to ours if they were to try work out the same math?",
            "authorDisplayName": "Brendon James Colby",
            "authorProfileImageUrl": "https://yt3.ggpht.com/ytc/AMLnZu8o9_mpQOLL4esBsYdreUsOYknhSAEYWHK-0QQMpw=s48-c-k-c0x00ffffff-no-rj",
